import './App.css';

function App() {
    return (
      <div className="m-6">
        <h1 className="text-3xl font-bold text-teal-600"> Webscrawler </h1>
        <form className="text-base">
          <label>
            Url:
            <input
              type="text"
              name="url"
              className="h-5 border-2 m-2 border-black"
            />
          </label>
          <input type="submit" value="Submit" className="bg-slate-300 p-1 rounded-lg" />
        </form>
      </div>
    );
}

export default App;
